import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./components/LoginComponent/LoginPage";
import AngajatPage from "./components/AngajatComponent/AngajatPage";
import ErrorModal from "./components/LoginComponent/ErrorModal";
import AdminHomePage from "./components/HomePageComponent/AdminHomePage";
import StocPage from "./components/StocComponent/StocPage";
import ProviderPage from "./components/FurnizorComponent/ProviderPage";
import ContabilitateHomePage from "./components/ContabilitateHomePageComponent/ContabilitateHomePage";

function App() {
  const [isErrorModalOpen, setIsErrorModalOpen] = useState(false); // State for the error modal

  const closeErrorModal = () => {
    setIsErrorModalOpen(false);
  };

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route
            path="/"
            element={
              <>
                <LoginPage setIsErrorModalOpen={setIsErrorModalOpen} />
                {isErrorModalOpen && <ErrorModal onClose={closeErrorModal} />}
              </>
            }
          />
          <Route path="/adminHomePage" element={<AdminHomePage />} />
          <Route path="/angajatPage" element={<AngajatPage />} />
          <Route path="/stocPage" element={<StocPage />} />
          <Route path="/providerPage" element={<ProviderPage />} />
          <Route
            path="/contabilitateHomePage"
            element={<ContabilitateHomePage />}
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
